window.bookSummaryJSON = "<p>Anne Shirley, the mischievous, carrot-topped waif of <i>Anne of Green Gables</i>, has grown into a lovely young woman who leaves the security of Prince Edward Island to enroll at Redmond College. There, she discovers a professor who believes education is wasted on women, ponders the security offered in marriage proposals, and a host of other questions of young adulthood.</p>"; 
